import './Fow.css'
import '../css/teams.css'
import React, { useState, useEffect } from 'react'; 

function Header(props) {
    let class1 = "fow_header1 " + props.color + "1"
    let class2 = "fow_header2 " + props.color + "2"
    return (
        <div className="fow_header">
            <div className={class1}>
                {props.teamname}
            </div>
            <div className={class2}>
                FOW
            </div>
        </div>
    );
}

function Fow(props) {
    let url = "http://localhost:8000/match/" + props.m_id + "/"+props.inn_no + "/fow"
    const [data, setData] = useState(null);

    useEffect(() => {
        const fetchData = async () => {
        const response = await fetch(url);
        const jsonData = await response.json();
        setData(jsonData);
        };

        fetchData();
    }, []);


    if (!data) {
        return <div>Loading...fow</div>;
      }

    console.log(data)
    return (
        <div id='fow'>
            <Header color={data.color} teamname={data.teamname}/>
        </div>
        );

    }
export default Fow;
